- proto: BookBase
  entities:
  - uid: 910
    components:
    - type: MetaData
      name: Триумф Сола Бэдмена!
    - type: Transform
      rot: -1.5707963267948966 rad
      pos: -37.485367,32.753597
      parent: 2
    - type: Paper
      content: >2+
         	Привет, я Сол Бэдмен. Вы знали, что у вас есть права? Корпоративный Закон говорит, что есть. И я тоже. Я считаю, что до тех пор, пока не будет доказана вина, каждый человек, феленид и даже вульпикан этой станции невиновны. И поэтому я борюсь за тебя, Нанотрахен.

        Один простой пример.

        " — Ты пошёл погулять, зависаешь в баре, отрываешься. Загоняешь дурачка симпотным тёлкам. И вдруг — ой, кто это? Сотрудник СБ... и смотрит на тебя. И что же он видит? А видит он молодого парня с шикарным домом на планетке, неограниченным запасом спеосов и без работы. И какой же вывод сделает СБ? — Я вор? — Нет! В миллион раз хуже. Ты уклоняешься от налогов! "

